import React, { useState, useEffect } from "react";

const questions = [
  {
    question: "Which of these animals is known for having a long neck?",
    options: ["Elephant", "Girrafee", "Kangaroo", "Tiger"],
    correct: 2,
    images: [
      "url('data:image/jpeg;base64,')",
      "url('data:image/jpeg;base64,')",
      "url('data:image/jpeg;base64,')",
      "url('data:image/jpeg;base64,')",
    ],
  },
  {
    question: "What is the name of Mickey Mouse's dog?",
    options: ["Pluto", "Tom", "Snoopy", "Goofy"],
    correct: 1,
    images: [
      "url('data:image/png;base64,')",
      "url('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSmiAfYTYjRGBEF9oBC7Z_agzDLb5pdw06n7f57k7VeW26ijoDLgQcftiCfTW_JE3OvpHY&usqp=CAU')",
      "url('data:image/jpeg;base64,')",
      "url('data:image/png;base64,')",
    ],
  },
  {
    question: "What do cows give us?",
    options: ["Eggs", "Milk", "Cheese", "Bread"],
    correct: 1,
    images: [
      "url('data:image/jpeg;base64,')",
      "url('data:image/jpeg;base64,')",
      "url('data:image/jpeg;base64,')",
      "url('data:image/jpeg;base64,')",
    ],
  },
];

const Quiz = () => {
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [score, setScore] = useState(0);
  const [timeLeft, setTimeLeft] = useState(5);
  const [isQuizFinished, setIsQuizFinished] = useState(false);

  useEffect(() => {
    if (timeLeft === 0) {
      handleNextQuestion();
    }
    const timer = setInterval(() => {
      setTimeLeft((prev) => (prev > 0 ? prev - 1 : 0));
    }, 1000);
    return () => clearInterval(timer);
  }, [timeLeft]);

  const handleAnswerOptionClick = (index) => {
    if (index === questions[currentQuestion].correct) {
      setScore(score + 1);
    }
    handleNextQuestion();
  };

  const handleNextQuestion = () => {
    const nextQuestion = currentQuestion + 1;
    if (nextQuestion < questions.length) {
      setCurrentQuestion(nextQuestion);
      setTimeLeft(10);
    } else {
      setIsQuizFinished(true);
    }
  };

  const getResultEmoji = () => {
    const percentage = (score / questions.length) * 100;
    if (percentage === 100) return "";
    if (percentage >= 80) return "";
    if (percentage >= 50) return "";
    return "";
  };

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-800 p-6">
      <div className="bg-white rounded-lg shadow-xl w-full max-w-3xl p-8">
        {isQuizFinished ? (
          <div className="text-center">
            <h2 className="text-3xl font-bold text-gray-700 mb-4">
              Your Score: {score} out of {questions.length}
            </h2>
            <div className="text-5xl mb-4">{getResultEmoji()}</div>
            {score >= 7 && (
              <div className="bg-purple-600 text-white p-4 rounded-lg shadow-lg mt-4">
                <h3 className="text-2xl font-semibold"> You deserve a party! </h3>
                <a
                  href="https://www.zomato.com"
                  target="_blank"
                  rel="noopener noreferrer"
                  className="mt-4 inline-block px-6 py-3 bg-yellow-500 text-black rounded-full font-bold hover:bg-yellow-400"
                >
                  Order Now
                </a>
              </div>
            )}
          </div>
        ) : (
          <div>
            <div className="flex justify-between mb-6">
              <div className="text-xl font-semibold text-gray-600">
                 Time left: {timeLeft} sec
              </div>
            </div>
            <h2 className="text-2xl font-bold text-gray-700 mb-4">
              {questions[currentQuestion].question}
            </h2>
            <div className="flex justify-between space-x-4">
              {questions[currentQuestion].options.map((option, index) => (
                <button
                  key={index}
                  onClick={() => handleAnswerOptionClick(index)}
                  className="w-48 h-72 bg-cover bg-center rounded-lg flex items-center justify-center text-black text-lg font-extrabold shadow-white hover:opacity-60 transition duration-300"
                  style={{
                    backgroundImage: questions[currentQuestion].images[index],
                  }}
                >
                  {option}
                </button>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Quiz;
